fn hash22(p: vec2<f32>) -> vec2<f32> {
    var p3 = fract(vec3<f32>(p.xyx) * vec3<f32>(0.1031, 0.1030, 0.0973));
    p3 += dot(p3, p3.yzx + 33.33);
    return fract((p3.xx + p3.yz) * p3.zy);
}

fn rotate2D(r: f32) -> mat2x2<f32> {
    let c = cos(r); let s = sin(r);
    return mat2x2<f32>(c, s, -s, c);
}

fn mainImage(invocation_id: vec2<f32>) -> vec4<f32> {
    let iResolution: vec2<f32> = uniforms.resolution.xy;
    let iTime: f32 = uniforms.time;
    let uv = (invocation_id - 0.5 * iResolution) / iResolution.y;

    var p = uv;
    var n = vec2<f32>(0.0);
    var warp_accum = 0.0;
    let m = rotate2D(5.0);

    for (var j: f32 = 0.0; j < 6.0; j += 1.0) {
        p = m * p;
        n = m * n;
        let q = p * 1.5 + iTime * 0.5 + n;
        warp_accum += dot(cos(q), vec2<f32>(0.2));
        n -= sin(q);
    }

    let cell_uv = uv * 8.0 + n; 
    let i_p = floor(cell_uv);
    let f_p = fract(cell_uv);

    var min_dist: f32 = 1.0;
    for (var y: f32 = -1.0; y <= 1.0; y += 1.0) {
        for (var x: f32 = -1.0; x <= 1.0; x += 1.0) {
            let neighbor = vec2<f32>(x, y);
            var point = hash22(i_p + neighbor);
            point = 0.5 + 0.5 * sin(iTime + 6.28 * point);
            let dist = length(neighbor + point - f_p);
            min_dist = min(min_dist, dist);
        }
    }

    let blood_red = vec3<f32>(0.4, 0.02, 0.05);
    let cell_color = vec3<f32>(1.0, 0.7, 0.6);

    let membrane = smoothstep(0.4, 0.1, min_dist);
    let glow = (1.0 - min_dist) * warp_accum;

    var final_rgb = mix(blood_red, cell_color, membrane);
    final_rgb += glow * vec3<f32>(0.8, 0.2, 0.1);

    final_rgb *= 1.2 - dot(uv, uv);

    return vec4<f32>(final_rgb, 1.0);
}

@fragment
fn main_fragment(in: VertexOutput) -> @location(0) vec4<f32> {      
	return mainImage(in.pos.xy);
}

