@group(0) @binding(0) var<uniform> uniforms: Uniforms;

const RAY_STEPS:f32 = 64.;

fn gyroid(p: vec4<f32>, scale: f32) -> f32 {
  let scaled_p = p * scale;
  let s = sin(scaled_p);
  let c = cos(vec4<f32>(scaled_p.z, scaled_p.x, scaled_p.w, scaled_p.y));
  return abs(dot(s, c) - 1.0) / scale;
}


fn mainImage(invocation_id: vec2<f32>) -> vec4<f32> {

  let C = invocation_id.xy;
  let r = uniforms.resolution;
  let T = uniforms.time;

  var o = vec4<f32>(0.0);
  var i = 0.0;
  var z = 0.0;
  var d = 0.0;
  var s = 0.0;
  var p = vec4<f32>(0.0);
  var q = vec4<f32>(0.0);

  let U = vec4<f32>(2.0, 1.0, 0.0, 3.0); 
  let U_z11 = 11.0 * U.z;
  let U_y11 = 11.0 * U.y;
  let U_w11 = 11.0 * U.w;

  loop {
    if (i >= RAY_STEPS) {
      break;
    }

    let ray = normalize(vec3<f32>(C - 0.5 * r.xy, r.y));
    z += d + 0.0005;

    q = vec4<f32>(ray * z, 0.2);
    q.z += T / 30.0;

    s = q.y + 0.1;
    q.y = abs(s);

    p = q;
    p.y -= 0.11;

    let angle = -2.0 * p.z; 
    let rot = mat2x2<f32>(
      cos(U_z11 + angle), cos(U_y11 + angle),
      cos(U_w11 + angle), cos(U_z11 + angle)
    );
    let rotated_xy = rot * p.xy;
    p = vec4<f32>(rotated_xy, p.z, p.w);    
    p.y -= 0.2;

    let gyroid1 = gyroid(p, 8.0);
    let gyroid2 = gyroid(p, 24.0);
    d = abs(gyroid1 - gyroid2) / 4.0;

    let color = 1.0 + cos(0.7 * U + 5.0 * q.z);

    let glow_strength = select(
      0.1 / max(d * d * d, 0.0005),
      1.0 / max(d, 0.0005),
      s > 0.0
    );

    o += color.w * color * glow_strength;

    i += 1.0;
  }

  let pulse = 1.4 + sin(T) * sin(1.7 * T) * sin(2.3 * T);
  o += pulse * 1000.0 * U / length(q.xy);
  let final_color = tanh(o / 50000.0);
  return vec4<f32>(final_color.rgb, 1.0);    
}



