fn rotation2D(theta: f32) -> mat2x2<f32> {
    let c = cos(theta);
    let s = sin(theta);
    return mat2x2<f32>(vec2<f32>(c, s), vec2<f32>(-s, c));
}

fn smin(a: f32, b: f32, k: f32) -> f32 {
  let h = clamp(0.5 + 0.5 * (b - a) / k, 0.0, 1.0);
  return mix(b, a, h) - k * h * (1.0 - h);
}

fn mainImage(invocation_id: vec2<f32>) -> vec4<f32> {

    var O: vec4<f32>; // Output color for this pixel
    var C: vec2<f32> = invocation_id.xy; // Pixel coordinates (0,0 to screen width/height)

    var d: f32; // Distance to closest surface
    var s: f32; // Scale factor
    var j: f32; // Loop counter for inner fractal iteration
    var i: f32 = 0.0; // Loop counter for main raymarching loop
    var z: f32 = 0.0; // Depth along the ray
    var N: f32; // Which string iteration was closest
    var D: f32; // Temporary distance
    var k: f32; // Coordinate scaling factor (for inversion)
    var t: f32 = uniforms.time; // Current time from uniforms

    var o: vec4<f32> = vec4<f32>(0.0); // Accumulated color/brightness
    var p: vec4<f32> = vec4<f32>(0.0);

    // U contains color constants for the final output.
    // U.wxyw is used to access components in a specific order for rotation.
    var U: vec4<f32> = vec4<f32>(3.0, 1.0, 2.0, 0.0);

      // Main raymarching loop
      // r = screen resolution, used to convert pixel coords to camera direction
      var r: vec2<f32> = uniforms.resolution.xy;

    // The loop iterates a fixed number of times (70) or until a surface is hit (implicitly by z increment).
    for (i = 0.0; i < 70.0; i = i + 1.0) {
        // Increment depth along the ray.
        // The step size is half the current distance to the closest surface, plus a small offset
        // to prevent infinite loops when d is very small.

        z = fma(0.5, d, z) + 0.001; // if precision is better this way

        // Calculate 3D ray direction from 2D pixel coordinates
        // Center coordinates around (0,0) and normalize to create camera ray.
        // The ray starts from the camera position and extends into the scene.
        var ray_direction: vec3<f32> = normalize(vec3<f32>(C - 0.5 * r, r.y));
        p = vec4<f32>(z * ray_direction, 0.0);

        // Move camera back 3 units from origin along the Z-axis.
        p.z = p.z - 3.0;

        // Apply "inversion" transformation (also known as @mla inversion or sphere inversion).
        // This transformation maps points inside a sphere to outside and vice-versa,
        // creating interesting fractal patterns.
        k = 16.0 / dot(p.xyz, p.xyz); // Calculate scaling factor based on distance from origin
        p = p * k; // Apply the scaling to the position vector

        // Take 2D slice of 3D position for string calculation.
        // The fractal is essentially 2D, projected into 3D space.
        var q: vec2<f32> = p.xy;

        // Create repeating pattern by subtracting rounded grid positions.
        // This tiles the fractal across space in 5x5 unit cells, making the pattern repeat.
        q = q - round(q / 5.0) * 5.0;

        // Create rotation matrix that changes over time and space.
        // log2(k) makes the rotation depend on the inversion depth, creating a swirling motion.
        // U.wxyw is used to pick specific components of the U vector for a unique rotation.
      //  var angle: f32 = 0.5 * t + log2(k) + 11.0 * U.w; // U.w is 0.0, so this simplifies to 0.5 * t + log2(k)

        let angle = fma(0.5, t, log2(k));

        var cos_angle: f32 = cos(angle);
        var sin_angle: f32 = sin(angle);

        // WGSL matrices are column-major, so we define them as columns.
        //var R: mat2x2<f32> = mat2x2<f32>(vec2<f32>(cos_angle, sin_angle), vec2<f32>(-sin_angle, cos_angle));

        let R = rotation2D(angle);

        // Inner loop: Generate fractal shape by iterating a formula (Mandelbrot-like iteration).
        // This loop refines the distance to the fractal surface.
        d = 1.0; // Initialize distance to 1.0 (arbitrary large value)
        s = 1.0; // Initialize scale factor to 1.0
        j = 1.0; // Initialize inner loop counter

        for (j = 1.0; j < 6.0; j = j + 1.0) {
            //s = s * 0.5; // Halve the scale each iteration, making the fractal zoom in.

            s = fma(s, 0.5, 0.0);

            // Fold space, rotate, and offset.
            // abs(q*R) performs a folding operation, mirroring parts of the space.
            // The subtraction creates the characteristic "string" shape.
            q = abs(q * R) ;//- vec2<f32>(2.0 * s / j);
            q -=  vec2<f32>(1.5 * s / j);

            //q = normalize(q) * length(q) - 2.0 * s / j


            // Calculate distance to current shape.          
            // length(q) gives the distance from the origin in the 2D plane.
            // s/8.0 creates an offset for the shape's boundary.
            D = length(q) - s / 8.0;

            // Keep track of the closest distance found so far and which iteration (N) it came from.
            if (D < d) {
                N = j;
                d = D;
            }
        }

        // Correct distance accounting for the inversion transformation.
        // The distance needs to be scaled by 'k' because the space itself was scaled.
        // abs(d) makes the strings appear translucent or hollow.
        d = abs(d) / k;

        // Calculate color based on position and string properties.
        // sin() creates oscillating colors, and N (which string iteration was closest)
        // adds variation based on the fractal's depth.
        // U.zywz accesses components of U in a specific order for color mixing.
        //p = vec4<f32>(1.0) + sin(p.z + U.z - t + N); // Note: U.z is 2.0, U.y is 1.0, U.w is 0.0

        p = vec4<f32>(1.0) + sin(vec4<f32>(p.z + U.z, p.z + U.y, p.z + U.w, p.z + U.z) - t + N);

        // Accumulate color and lighting:
        // Add color inversely proportional to distance (closer = brighter).
        // The max(d, 1E-3) prevents division by zero if d is extremely small.
        var color_contribution: vec4<f32> = vec4<f32>(p.xyz, 1.0) / max(d, 0.001);
        //var color_contribution: vec4<f32> = p.w / max(d, 0.001) * p;

        // Add a glow effect that increases with depth (k).
        // exp(0.3 * k) creates an exponential glow.
        var glow_effect: vec4<f32> = exp(0.3 * k) * 6.0 * U;

        o = o + color_contribution + glow_effect;
    }

    // Final color output: normalize accumulated brightness and apply tone mapping.
    // tanh() is a tone mapping operator that compresses high dynamic range colors
    // into a displayable range, preventing them from becoming too bright.
    O = tanh(o / 30000.0); // Divide by a large number to scale down the accumulated brightness.


     return O;

	}



